public boolean isDefaultDimensionEditable()
{
    Map     ledgerDimensionSpecifiers;

    if (this.isRebateEditable())
    {
        ledgerDimensionSpecifiers = LedgerDimensionDefaultingEngine::getLedgerDimensionSpecifiers(tamVendRebateTable.LedgerDimension, true);
        return ledgerDimensionSpecifiers.empty();
    }

    return false;
}

public boolean isRebateEditable()
{
    return tamVendRebateTable.RebateStatus != TAMVendRebateStatus::Processed &&
           tamVendRebateTable.RebateStatus != TAMVendRebateStatus::Approved;
}

